import * as React from 'react';
import Form from 'react-bootstrap/Form';


function ToggleDarkMode() {
    return (
        <button><Form>
            <Form.Check
            type="switch"
            id="custom-switch"
            label="Dark"
            />
        </Form>
        </button>
    );
}

export default ToggleDarkMode;
